
DROP TABLE IF EXISTS `d_account`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `d_account` (
  `id` int(11) unsigned NOT NULL COMMENT '系统编号，对应d_user表的uid',
  `pid` varchar(150) NOT NULL COMMENT 'openid',
  `token` varchar(150) DEFAULT NULL,
  `version` varchar(30) NOT NULL,
  `unionid` varchar(32) DEFAULT NULL COMMENT '微信unionid',
  `playername` varchar(100) DEFAULT NULL COMMENT '昵称',
  `usericon` varchar(300) DEFAULT NULL COMMENT '头像',
  `sex` tinyint(1) DEFAULT NULL COMMENT '性别',
  `logintype` tinyint(1) DEFAULT '1' COMMENT '登录方式',
  `platform` tinyint(1) DEFAULT '0' COMMENT '1 安卓 2ios 3web',
  `password` varchar(32) DEFAULT NULL,
  `salt` char(6) DEFAULT NULL,
  `fbid` varchar(30) DEFAULT NULL,
  `times` int(11) DEFAULT '0' COMMENT 'playername重复次数',
  `invit_uid` bigint(20) DEFAULT '0' COMMENT '邀请人uid',
  `ppid` bigint(20) DEFAULT '0' COMMENT '上上级id',
  `pppid` bigint(20) DEFAULT '0' COMMENT '源头uid',
  `regtype` tinyint(1) DEFAULT '0' COMMENT '注册方式',
  `openid` varchar(32) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '0' COMMENT '0未同步 1已同步',
  `oid` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `pid_sdkid` (`pid`) USING BTREE,
  KEY `idx_playername` (`playername`),
  KEY `idx_invit_uid` (`invit_uid`),
  KEY `idx_token` (`token`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='帐号表';
/*!40101 SET character_set_client = @saved_cs_client */;

