DROP TABLE IF EXISTS `d_desk`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `d_desk` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '房间表自增id',
  `deskid` bigint(20) DEFAULT NULL COMMENT '桌子/房间id',
  `gameid` int(11) DEFAULT NULL COMMENT '游戏id',
  `sessionid` int(11) DEFAULT '0' COMMENT '场次类型id',
  `owner` bigint(20) DEFAULT NULL COMMENT '房间创建人',
  `typeid` tinyint(1) DEFAULT '1' COMMENT '玩法模式 1经典场 跟游戏有关',
  `status` tinyint(1) DEFAULT '0' COMMENT '房间状态 0待准备 1准备 2开牌 3结束 4已解散',
  `seat` int(11) DEFAULT '0' COMMENT '最大座位数',
  `curseat` int(11) DEFAULT '0' COMMENT '现在人数',
  `maxround` int(11) DEFAULT '15' COMMENT '最大轮数',
  `waittime` int(11) DEFAULT '0' COMMENT '等待时长,秒',
  `stuffy` int(11) DEFAULT '1' COMMENT '必闷轮数',
  `joinmiddle` tinyint(1) DEFAULT '0' COMMENT '是否中途加入 1是 0否',
  `rubcard` tinyint(1) DEFAULT '0' COMMENT '是否搓牌 1是 0否',
  `opengps` tinyint(1) DEFAULT '0' COMMENT '开启gps 1开启 0否',
  `betbase` int(11) DEFAULT '0' COMMENT '底注',
  `mincoin` int(11) DEFAULT '0' COMMENT '最少入场金币数',
  `leftcoin` int(11) DEFAULT '0' COMMENT '离场金币',
  `round_num_no_pk` int(11) DEFAULT '0' COMMENT '前N轮不能比牌',
  `pot_current` bigint(20) DEFAULT '0' COMMENT '房间当前押注',
  `bet_call_current` bigint(20) DEFAULT '0' COMMENT '当前轮押注',
  `curround` int(11) DEFAULT '1' COMMENT '当前轮数',
  `watchnum` int(11) DEFAULT '0' COMMENT '允许观战人数',
  `create_time` int(11) DEFAULT NULL,
  `endtime` int(11) DEFAULT NULL COMMENT '结束时间',
  `uuid` varchar(32) DEFAULT '' COMMENT '唯一id',
  PRIMARY KEY (`id`),
  KEY `idx_game_session` (`gameid`,`sessionid`) USING BTREE,
  KEY `idx_deskid` (`deskid`) USING BTREE,
  KEY `idx_uuid` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=7288 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='房间信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

