DROP TABLE IF EXISTS `d_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `d_user` (
  `uid` bigint(20) NOT NULL COMMENT '用户id',
  `token` varchar(32) DEFAULT NULL COMMENT '微信授权token',
  `playername` varchar(100) DEFAULT NULL COMMENT '玩家昵称',
  `isbindfb` tinyint(1) DEFAULT '0' COMMENT '是否绑定过fb',
  `agent` tinyint(1) DEFAULT '0' COMMENT '代理级别 0玩家 1普通 2高级',
  `usericon` varchar(300) DEFAULT NULL COMMENT '玩家头像地址',
  `sex` tinyint(1) DEFAULT '1' COMMENT '性别1男 0女',
  `create_time` int(11) DEFAULT NULL COMMENT '注册时间',
  `create_platform` tinyint(1) DEFAULT '0' COMMENT '注册时的平台',
  `coin` decimal(15,2) DEFAULT NULL COMMENT '金币数',
  `code` varchar(8) DEFAULT NULL COMMENT '邀请码',
  `from_channel` varchar(20) DEFAULT NULL COMMENT '注册渠道来源',
  `memo` varchar(100) DEFAULT NULL COMMENT '个人描述',
  `login_time` int(11) DEFAULT NULL COMMENT '登录时间',
  `login_ip` varchar(15) DEFAULT NULL COMMENT '登录ip',
  `invit_uid` bigint(20) DEFAULT NULL COMMENT '上级邀请人',
  `status` tinyint(1) DEFAULT '1' COMMENT '正常 1是 0否',
  `sharetime` int(11) DEFAULT NULL,
  `realname` varchar(100) DEFAULT NULL COMMENT '姓名',
  `idcard` varchar(32) DEFAULT NULL COMMENT '身份证',
  `contact` varchar(32) DEFAULT NULL COMMENT '第3方平台账号',
  `contact_type` tinyint(1) DEFAULT '0' COMMENT '1 fb 2weixin',
  `ispayer` tinyint(1) DEFAULT '0' COMMENT '0未充值 1充值用户',
  `totalpay` bigint(20) DEFAULT '0' COMMENT '累计充值',
  `active` tinyint(1) DEFAULT '1' COMMENT '1新用户 2活跃用户 3回归用户',
  `login_days` int(11) DEFAULT '0' COMMENT '连续登陆天数',
  `wintimes` int(11) DEFAULT '0' COMMENT '总的赢次数',
  `alltimes` int(11) DEFAULT '0' COMMENT '总的游戏局数',
  `isrobot` tinyint(1) DEFAULT NULL,
  `iswhite` tinyint(1) DEFAULT '0' COMMENT '是否在白名单中',
  `isblack` tinyint(1) DEFAULT '0' COMMENT '是否在黑名单中',
  `reservecoin` int(11) DEFAULT NULL,
  `limitcoin` int(11) DEFAULT NULL,
  `platform` tinyint(1) DEFAULT '0' COMMENT '登录方式',
  `daytime` int(11) DEFAULT NULL,
  `onlinestate` tinyint(1) DEFAULT NULL,
  `curonlinejd` tinyint(1) DEFAULT NULL COMMENT '当前执行阶段',
  `lrwardstate` tinyint(1) DEFAULT '1',
  `praisetime` int(11) DEFAULT '0' COMMENT '5星好评时间',
  `invitednum` int(11) DEFAULT '0' COMMENT '邀请的下线人数',
  `invitedfb` int(11) DEFAULT '0' COMMENT '邀请的fb下线人数',
  `isbindwx` tinyint(1) DEFAULT '0' COMMENT '是否绑定微信 1是',
  `uuid` int(11) DEFAULT '0' COMMENT '修改人',
  `update_time` int(11) DEFAULT '0' COMMENT '修改时间',
  `spread` tinyint(1) DEFAULT '0' COMMENT '0无 1二级 2一级 3总代',
  `evoaccount` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`uid`),
  KEY `idx_code` (`code`) USING BTREE,
  KEY `idx_create` (`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='用户信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

