--
-- Table structure for table `s_game`
--

DROP TABLE IF EXISTS `s_game`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `s_game` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1' COMMENT '1正常 2维护中 0暂不上线',
  `create_time` int(11) DEFAULT '0' COMMENT '创建时间',
  `ord` int(11) DEFAULT '100' COMMENT '排序，大的靠前',
  `robotcoin` decimal(20,2) DEFAULT '0.00' COMMENT '机器人钱包',
  `bankercoin` decimal(20,2) DEFAULT '0.00' COMMENT '系统庄钱包',
  `lv` int(11) DEFAULT '0' COMMENT '-1 地狱 0普通 2天堂',
  `storage` bigint(20) DEFAULT '0' COMMENT '输赢库存',
  `newmark` tinyint(1) DEFAULT '0' COMMENT '是否要更新库存1是0否',
  `newstorage` bigint(20) DEFAULT '0' COMMENT '新库存',
  `targetstorage` bigint(20) DEFAULT '0' COMMENT '目标库存',
  `targetminrate` int(11) DEFAULT '0' COMMENT '目标库存允许最低比例',
  `winrate` int(11) DEFAULT '0' COMMENT '赢的百分比',
  `loserate` int(11) DEFAULT '0' COMMENT '输的百分比',
  `storaterate` int(11) DEFAULT '0' COMMENT '进入库存百分比',
  `iscontrol` tinyint(1) DEFAULT '0' COMMENT '1是 0否',
  `update_time` int(11) DEFAULT NULL,
  `uuid` int(11) DEFAULT NULL,
  `cuid` int(11) DEFAULT NULL,
  `robot` varchar(1000) DEFAULT NULL COMMENT '机器人行为',
  `control` mediumtext COMMENT '控制输赢json',
  `isHundred` tinyint(1) DEFAULT '0' COMMENT '是否百人场1',
  `apply_coin` bigint(20) DEFAULT '0' COMMENT '申请上庄金币',
  `bet_mincoin` bigint(20) DEFAULT '0' COMMENT '允许下注金币下限',
  `type` varchar(32) DEFAULT '0' COMMENT '分类 1在线 2slots 3hot 4arcade 5cannon',
  `version` varchar(32) DEFAULT '' COMMENT '游戏版本号',
  `aicontrol` mediumtext COMMENT '控制机器人json',
  PRIMARY KEY (`id`),
  KEY `idx_ord` (`ord`)
) ENGINE=InnoDB AUTO_INCREMENT=30211 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='游戏信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

