--
-- Table structure for table `s_sess_roomcard`
--

DROP TABLE IF EXISTS `s_sess_roomcard`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `s_sess_roomcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `gameid` int(11) DEFAULT '0' COMMENT '游戏id',
  `title` varchar(128) DEFAULT NULL COMMENT '场次名称',
  `basecoin` int(11) DEFAULT '0' COMMENT '底分',
  `mincoin` int(11) DEFAULT '0' COMMENT '最低入场',
  `leftcoin` int(11) DEFAULT '0' COMMENT '离场金币',
  `hot` tinyint(1) DEFAULT '1' COMMENT '热度1一般 2中等 3火爆',
  `status` tinyint(1) DEFAULT '1' COMMENT '1正常开放 0关闭',
  `ord` int(11) DEFAULT '100' COMMENT '排序',
  `free` tinyint(1) DEFAULT '0' COMMENT '是否体验场',
  `level` tinyint(1) DEFAULT NULL COMMENT '参数级别1体验 2中级 3高级',
  `param1` int(1) DEFAULT NULL COMMENT '扩充字段1',
  `param2` int(1) DEFAULT NULL COMMENT '扩充字段2',
  `param3` int(1) DEFAULT NULL COMMENT '扩充字段3',
  `param4` int(11) DEFAULT NULL,
  `revenue` int(11) DEFAULT '0' COMMENT '茶水费比例,50表示50%',
  PRIMARY KEY (`id`),
  KEY `idx_game` (`gameid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='游戏私人房信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

