DROP TABLE IF EXISTS `s_tax`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `s_tax` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `gameid` int(11) DEFAULT '0' COMMENT '游戏id',
  `level` tinyint(1) DEFAULT '0' COMMENT '场次id',
  `deskid` varchar(8) DEFAULT NULL COMMENT '房间号',
  `uid` bigint(20) DEFAULT '0' COMMENT '玩家id',
  `coin` decimal(10,2) DEFAULT NULL,
  `create_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `isrobot` tinyint(1) DEFAULT '0' COMMENT '是否机器人 0否 1是',
  `uuid` varchar(32) DEFAULT '' COMMENT '唯一id',
  PRIMARY KEY (`id`),
  KEY `idx_deskid` (`deskid`),
  KEY `idx_create_time` (`create_time`),
  KEY `idx_uuid` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='税收记录';
/*!40101 SET character_set_client = @saved_cs_client */;

DROP TABLE IF EXISTS `apipool_log`;
CREATE TABLE `apipool_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `loanid` varchar(64) DEFAULT NULL,
  `coin` decimal(22,4) DEFAULT NULL,
  `jpcoin` decimal(22,4) DEFAULT NULL,
  `gameid` int(11) DEFAULT NULL,
  `deskuuid` varchar(64) DEFAULT NULL,
  `deskid` varchar(32) DEFAULT NULL,
  `uid` bigint(20) DEFAULT NULL,
  `ext1` varchar(255) DEFAULT NULL,
  `ext2` varchar(255) DEFAULT NULL,
  `time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `loanid` (`loanid`),
  KEY `gameid` (`gameid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='API借款明细表';


CREATE TABLE `evo_amount_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `ticketid` varchar(64) DEFAULT NULL,
  `amount` decimal(22,4) DEFAULT NULL,
  `backamount` decimal(22,4) DEFAULT NULL,
  `state` int(11) DEFAULT NULL,
  `gameid` int(11) DEFAULT NULL,
  `deskuuid` varchar(64) DEFAULT NULL,
  `deskid` varchar(32) DEFAULT NULL,
  `uid` bigint(20) DEFAULT NULL,
  `evoaccount` varchar(30) DEFAULT NULL,
  `time` int(11) DEFAULT NULL,
  `updatetime` int(11) DEFAULT NULL,
  `checktime` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `state` (`state`),
  KEY `evoaccount` (`evoaccount`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COMMENT='evo_amount对账表';

